import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, View, TouchableOpacity } from 'react-native';

export default function App() {
  return (
    <View style={styles.container}>
      <Text style={styles.instructions}>Open up App.js to start working on your app!</Text>
      <StatusBar style="auto" />

      <TouchableOpacity onPress={() => alert('hello world')} style={styles.button_one}>
        <Text style={styles.button_text}>Press Me!</Text>
      </TouchableOpacity>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  instructions: {
    color: '#888',
    fontSize: 18,
    marginHorizontal: 15,
    marginBottom: 10,
  },
  button_one: {
    backgroundColor: '#111',
    padding: 20,
    borderRadius: 5,
  },
  button_text: {
    fontSize: 20,
    color: '#fff',
  }
});
